import React from 'react';
import { Outlet, Link } from 'react-router-dom';
import immeubles from '../../';

const Nav = (props) => {
    return (
        <>
            <nav className='list-none mt-4 mb-4 md:flex md:w-full lg:mt-[70px]'>
            <div className='bg-zinc-800 md:bg-black'>
                <img
                    className='absolute w-screen h-screen mx-center object-cover mix-blend-overlay md:hidden'
                    src={immeubles}
                    alt='/'
                />
            </div>
                <ul className='text-red-400 text-lg text-center p-4 md:w-full md:flex md:justify-around lg:text-2xl lg:font-bold'>
                    <li className='pb-2 hover:text-red-300 hover:underline'>
                        <Link to='/'>Présentation</Link>
                    </li>
                    <li className='pb-2 hover:text-red-300 hover:underline'>
                        <Link to='/curriculum'>Mes projets</Link>
                    </li>
                    <li className='pb-2 hover:text-red-300 hover:underline'>
                        <Link to='/contact'>Contact</Link>
                    </li>
                </ul>
            </nav>
            <Outlet />
        </>
    );
};

export default Nav;
